import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MainPage from './MainPage';
import NursePage from './NursePage';
import PatientAdministrationForm from './SurveillanceForm'; // Update the import to match your form file names
import PatientSurgeryForm from './SurgeryForm';
import PatientAntibioticForm from './AntibioticForm';
import PatientMicrobiologyForm from './MicrobiologyForm';
import PatientEventForm from './EventDetailsForm';
import SSIEvaluationForm from './SSIEvaluationForm';

const NotFound = () => <h2>Page Not Found</h2>;

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<MainPage />} />
        <Route path="/nurse" element={<NursePage />} />
        <Route path="/surveillance-form" element={<PatientAdministrationForm />} />
        <Route path="/surgery-form" element={<PatientSurgeryForm />} />
        <Route path="/antibiotic-form" element={<PatientAntibioticForm />} />
        <Route path="/microbiology-form" element={<PatientMicrobiologyForm />} />
        <Route path="/event-details-form" element={<PatientEventForm />} />
        <Route path="/ssi-evaluation-form" element={<SSIEvaluationForm />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
};

// Make sure to export the App component
export default App;
